import React, { useState } from "react";
import PlayerList from "../../components/PlayerList/PlayerList";
import SearchPlayers from "../../components/SearchPlayer/SearchPlayers";

const MyTeamPage = () => {
  const [players] = useState([
    {
      id: 1,
      firstName: "E.",
      lastName: "Haaland",
      team: "Manchester City",
      position: "Attacker",
      headshotUrl: "https://example.com/haaland.png",
      stats: "32.5 mln",
    },
    {
      id: 2,
      firstName: "Vinicius",
      lastName: "Jr",
      team: "Real Madrid",
      position: "Attacker",
      headshotUrl: "https://example.com/vinicius.png",
      stats: "29.2 mln",
    },
    // Add more sample players as needed
  ]);

  return (
    <main className="player-page-main">
      <section className="players-section">
        <h2>Players</h2>
        <div className="players-grid">
          {players.map((player) => (
            <div key={player.id} className="player-card">
              <img
                src={player.headshotUrl}
                alt={`${player.firstName} ${player.lastName}`}
                className="player-image"
              />
              <div className="player-info">
                <span className="player-name">
                  {player.firstName} {player.lastName}
                </span>
                <span className="player-team">{player.team}</span>
                <span className="player-stats">{player.stats}</span>
              </div>
            </div>
          ))}
        </div>
      </section>
    </main>
  );
};

export default MyTeamPage;
